瞬間ホイップ機能で簡単洗顔！フワフワもちもちの泡が、肌に残った古い角質やベタつく皮脂をごっそりピールクリア！毎日のシェービングにも使えます。<br><br><br>柑橘王子 フェイシャルクリアホイップN アロマオレンジの香り 360ml<br>簡単ワンプッシュのふわふわミクロ泡で包みこむ毛穴・角質ケア洗顔料です。古い角質、べとつく皮脂、毛穴の汚れもさっぱり綺麗にピールクリア。天然成分配合で荒れ肌や敏感肌にもやさしく、健康的な清潔美肌に洗い上げます。毎日のシェービングにもご使用いただけます。<br> 使用方法：手のひらに適量(ポンプ2-3回プッシュ)をとり、顔をマッサージするように優しく洗った後、水でよく洗い流してください。使い始めは中身が出るまで数回押してください。シェービングに使用する場合は、肌を十分にぬらした後、適量を塗ってお使いください。※ご使用の際は、ポンプ部分のストッパーを外してください。 <br>ご注意：●傷・はれもの・湿疹等、お肌に異常がある時やお肌に合わない時はご使用をおやめください。<br>●使用中または使用後に、お肌に刺激、赤み、かゆみ等の異常が現れた場合は使用を中止し、皮フ科専門医等へのご相談をお勧めします。<br>●目に入ったときは直ちに洗い流してください。<br>●極端に高温または低温の場所、直射日光の当たる場所では保管しないでください。<br>●乳幼児の手の届かない所に保管してください。<br> 成分<br>水、グリセリン、カリ石けん素地、BG、コカミドプロピルベタイン、オレンジ油、リンゴ酸、チャ葉エキス、メントール、クエン酸、乳酸、グルコース、水酸化K、ココイルグリシンK、ヤシ脂肪酸アルギニン、グルタミン酸ジ酢酸4Na、PEG-40水添ヒマシ油、香料、フェノキシエタノール <br>原産国：日本<br><br> お問い合わせ先：コスメティックスローランド株式会社0120-91-1213  <br>販売_製造元： コスメテックスローランド<br>ブランド：柑橘王子<br>JAN：4936201055265<br>CS：18<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
